        return new Source("{% extends 'base.html.twig' %}
{% block title %}Hello LuxuryController!{% endblock %}
{% block stylesheets %}

  <link href=\"https://cdn.jsdelivr.net/npm/bootstrap@5.1.3/dist/css/bootstrap.min.css\" rel=\"stylesheet\" integrity=\"sha384-1BmE4kWBq78iYhFldvKuhfTAU6auU8tT94WrHftjDbrCEXSU1oBoqyl2QvZ6jIW3\" crossorigin=\"anonymous\">

{% endblock %}

{% block javascripts %}
  <script src=\"https://cdn.jsdelivr.net/npm/bootstrap@5.1.3/dist/js/bootstrap.bundle.min.js\" integrity=\"sha384-ka7Sk0Gln4gmtz2MlQnikT1wXgYsOg+OMhuP+IlRH9sENBO0LRn5q+8nbTov4+1p\" crossorigin=\"anonymous\"></script>
{% endblock %}

{% block content %}
  <div class=\"example-wrapper\">
    <h1>
      Les voitures de luxes</h1>

    {% for car in collectionCars %}
      <div class=\"d-flex flex-row \">
        <div class=\"card\" style=\"width: 15rem;margin-right:2em;margin-top:2em;\">
          <img class=\"card-img-top\" src={{car.image }} style=\"width:10vw; height:25vh;\" alt=\"Card image cap\">
          <div class=\"card-body\">
            <h5 class=\"card-title\">Luxury Car</h5>
            <p class=\"card-text\">{{ car.marque }}
              {{car.modele}}</p>
            <p class=\"card-text\">{{car.prix}}
              €</p>
            <a href=\"{{ path('add_panier',{id: car.id}) }}\">
              <button class=\"btn btn-primary\" id=\"button\">Ajouter au panier</button>
            </a>
          </div>

        </div>
      {% endfor %}

      {% block page_contents %}{% endblock %}
    {% endblock %}
